import * as React from 'react';
import './tabs.scss';

type TitlesProps = {
  titles: {
    title: string;
    submenu?: {
      title: string;
    }[];
  }[];
};

const Tabs: React.FC<TitlesProps> = ({ titles }) => {
  return (
    <div className={'tabs-wrapper'}>
      <ul className="tabs">
        {titles.map(({ title }) => (
          <li key={title} className="tab">
            <a href="#">{title}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export { Tabs };
